create table book (
	book_id INT,
	title VARCHAR(59),
	genre VARCHAR(11),
	quantity INT,
	status INT,
	published_year DATE,
	published_house VARCHAR(50),
	avg_star DECIMAL(2,1),
	author_id INT
);



create table MOCK_DATA (
	book_id INT,
	staff_id INT
);


alter table book
add column staff_id INT;

update book
set staff_id = MOCK_DATA.staff_id
from MOCK_DATA 
where book.book_id = MOCK_DATA.book_id;

drop table MOCK_DATA RESTRICT;
alter table book rename to books;